import React from 'react'


class DetailsDeveloper extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div style={{margin:"0 2%"}}>
            <div style={{margin:"0 2%"}}><h1>AdminLogin Page</h1></div><br></br>
            <Form method="post" action={`${url}/admin_login`} horizontal>
            <FormGroup controlId="formHorizontalEmail">
                            <Col componentClass={ControlLabel} sm={2}>
                            Skills
                            </Col>
                            <Col sm={5}>
                            <FormControl type="text" placeholder="Enter Your Skills(only name)" />
                            </Col>
                        </FormGroup>
                        <FormGroup>
                            <Col smOffset={2} sm={5}>
                            <Button type="submit">Sign in</Button>
                            </Col>
                        </FormGroup>
                        </Form>
                        </div>
        )
    }
}
export default DetailsDeveloper;
